function Navbar() {
  return (
    <div>

      <nav class="navbar">
        <div class="container">
          <a href="#">Hulk</a>
          <a href="#" class="logo is-active">Mavel</a>
          <a href="#">Venom</a>
        </div>
      </nav>
      <style jsx>{`
      .navbar {
        width: 100%;
        height: 8rem;
        background-color: var(--color-secondary);
        color: #ffffff;
        position: fixed;
        left: 0;
        top: 0;
        z-index: 99;
        box-shadow: 0px 6px 8px rgba(0, 0, 0, 0.5);
      }

      `}
      </style>
    </div>
  )
}

export default Navbar
